KJE.definitions.set("**401K_ANNUAL_LIMITS**","The annual maximum for 2024 is $23,000.  If you are age 50 or over, a 'catch-up' provision allows you to contribute an additional $7,500 into your account. The SECURE 2.0 Act of 2022 increases the catch-up contribution beginning in 2025 for individuals age 60 to 63 to 50% of the standard contribution limit.  Beginning in 2026 catch-up contributions must be made as Roth contributions for individuals making more than $145,000 (adjusted for inflation) in the previous year.  The current calculator does not include the future catch-up contribution limit or Roth requirement which are subject to pending IRS rule finalization and clarification.");
KJE.definitions.set("**401k_ANNUAL_LIMITS_LONG**","The annual maximum for 2024 is $23,000 (the Code Section 402(g) limit). If you are age 50 or over, a 'catch-up' provision allows you to contribute even more to your 401(k) account, provided your employer's plan allows catch-up contributions. In 2024, the 'catch-up' provision allows you to contribute an additional $7,500 into your account. The SECURE 2.0 Act of 2022 increases the catch-up contribution beginning in 2025 for individuals age 60 to 63 to 50% of the standard contribution limit.<p>Beginning in 2026, subject to pending IRS rules and clarification, catch-up contributions must be made as Roth contributions for individuals making more than $145,000 (adjusted for inflation) in the previous year.  The current calculator does not include the future catch-up contribution limit or Roth requirement which are subject to pending IRS rule finalization and clarification.");
KJE.definitions.set("**401k_HIGHLY_COMPENSATED**","If you expect your salary to be $155,000 or more in 2024 or was $150,000 or more in 2023, you may need to contact your employer to see if these additional contribution limits apply to you.");
KJE.definitions.set("**401k_HIGHLY_COMPENSATED_LONG**","Employees classified as 'Highly Compensated' (those employees who either earn over $155,000 in 2024 or own more than 5% of the company) may be subject to a lower annual contribution limit due to the rate of participation of Non-highly Compensated employees versus Highly Compensated employees during the year.");
KJE.definitions.set("**403B_ANNUAL_LIMITS**","The annual maximum for 2024 is $23,000.  If you are age 50 or over, a 'catch-up' provision allows you to contribute an additional $7,500 into your 403(b) account. The SECURE 2.0 Act of 2022 increases the catch-up contribution beginning in 2025 for individuals age 60 to 63 to 50% of the standard contribution limit.  Beginning in 2026 catch-up contributions must be made as Roth contributions for individuals making more than $145,000 (adjusted for inflation) in the previous year.  The current calculator does not include the future catch-up contribution limit or Roth requirement which are subject to pending IRS rule finalization and clarification.");
