KJE.InputScreenText=" <div id=KJE-D-INPUTS><div id=KJE-P-INPUTS>Input information:</div></div> <div id=KJE-E-INPUTS > <div id='KJE-C-CURRENT_AGE'><input id='KJE-CURRENT_AGE' /></div> <div id='KJE-C-CURRENT_INCOME'><input id='KJE-CURRENT_INCOME' /></div> <div id='KJE-C-CURRENT_TAX_RATE'><input id='KJE-CURRENT_TAX_RATE' /></div> <div id='KJE-C-RETIREMENT_TAX_RATE'><input id='KJE-RETIREMENT_TAX_RATE' /></div> <div id='KJE-C-RATE_OF_RETURN'><input id='KJE-RATE_OF_RETURN' /></div> <div id='KJE-C-AGE_OF_RETIREMENT'><input id='KJE-AGE_OF_RETIREMENT' /></div> <div id='KJE-C-ANNUAL_CONTRIBUTION'><input id='KJE-ANNUAL_CONTRIBUTION' /></div> <div id='KJE-C-PAY_PERIOD'>**PAY_PERIOD**</div> <div id='KJE-C-CONTRIBUTION_TYPE'>**CONTRIBUTION_TYPE**</div> <div class=KJEDropperSpacer></div> </div> **GRAPH1** ";
KJE.DefinitionText=" <div id='KJE-D-CURRENT_AGE' ><dt>Current age</dt><dd>Your current age.</dd></div> <div id='KJE-D-AGE_OF_RETIREMENT' ><dt>Age at retirement</dt><dd>Age you wish to retire.</dd></div> <div id='KJE-D-CURRENT_TAX_RATE' ><dt>Current tax rate</dt><dd>The current marginal income tax rate you expect to pay on your taxable income. **TAXTABLE_CURRENT_DEFINITION**</dd></div> <div id='KJE-D-RETIREMENT_TAX_RATE' ><dt>Retirement tax rate</dt><dd>The marginal federal income tax rate you expect to pay on your retirement account distributions. Keep in mind that the calculator does not factor in other taxes such as state taxes, which could affect the comparison.</dd></div> <div id='KJE-D-RATE_OF_RETURN' ><dt>Hypothetical rate of return</dt><dd>The hypothetical annual effective rate of return for your 401(k) account. This calculator assumes that your deposits are made at the beginning of each pay period. For annual pay frequencies, it assumes the contributions are made at the beginning of the year. The actual rate of return is largely dependent on the type of investments you select. <p>It is important to remember that future rates of return can't be predicted and that investments that have a higher return potential are subject to higher risk and volatility. The actual rate of return on investments can vary widely over time. This includes the potential loss of principal on your investment.</dd></div> <div id='KJE-D-CURRENT_INCOME' ><dt>Current income</dt><dd>This is your current annual income.</dd></div> <div id='KJE-D-ANNUAL_CONTRIBUTION' ><dt>Annual contribution</dt><dd><p>The amount you expect to contribute to a 401(k) each year. This calculator assumes that new contributions to your account are made until you reach your retirement age. If you are currently age 29 and expect to retire at age 65, your first new contribution will happen at age 30 and continue until through age 65.<p> **401k_ANNUAL_LIMITS_LONG** It is also important to note that employer contributions will not count towards the employee's annual contribution limit under Code Section 402(g). Both the annual maximum and 'catch-up' provisions are indexed for inflation. Your plan may also impose limits on how much you can contribute.<p> Some employees are subject to another form of contribution limits. Employees classified as 'Highly Compensated' may be subject to contribution limits based on their employer's overall 401(k) participation. You may need to contact your employer to see if these additional contribution limits apply to you.</dd></div> <div id='KJE-D-CONTRIBUTION_TYPE' ><dt>Current contribution type</dt><dd>This is either Roth or Traditional. If you choose 'Roth' the calculator will increase the assumed contribution to your 'Traditional' option to equal the same net take home pay. If you choose 'Traditional' the calculator will decrease the assumed contribution to your 'Roth' option to equal the same net take home pay.</dd></div> <div id='KJE-D-PAY_PERIOD' ><dt>Pay frequency</dt><dd>How often you are paid. The tool uses this entry to calculate the net impact on your paycheck.</dd></div> <div><dt>Qualified Distribution</dt><dd>There are two requirements to take a qualified distribution from a Roth 401(k) account. A qualified distribution is one that is taken (i) at least five tax years from the year of your first Roth 401(k) contribution; and (ii) on or after the date on which you reach age 59 1/2 (or upon disability or death).</dd></div> <div><dt>Hypothetical Value at Retirement Age after Taxes, Traditional 401(k) and After-Tax Amount Invested</dt><dd>For the Roth 401(k), this is the total value of the account. For the traditional 401(k), this is the sum of two parts: 1) The value of the account after you pay income taxes on all earnings and tax-deferred contributions and 2) The accumulated value of the income tax savings of any contributions that exceeded your 401(k) contribution limit, if any, if you invested them as after-tax contributions to a tax-deferred vehicle. For these earnings, distributions are taxed at the same tax rate you indicate in the Retirement tax rate.</dd></div> ";
KJE.ReportText=' <!--HEADING "Roth 401(k) or Traditional 401(k)?" HEADING--> <h2 class=\'KJEReportHeader KJEFontHeading\'>RESULTS_MSG</h2> This comparison is based on a PAY_LABEL_LOWER Roth 401(k) contribution of ROTH_PAY_PERIOD and a PAY_LABEL_LOWER Traditional 401(k) contribution of TRADITIONAL_PAY_PERIOD. <!--NOTAXABLE_SAVINGS-->After taxes, either contribution would both reduce your take home pay by ROTH_PAY.<!--/NOTAXABLE_SAVINGS--> <!--TAXABLE_SAVINGS-->After taxes, your Roth contributions reduces your take home pay by ROTH_PAY, your Traditional 401(k) contribution reduces your take home pay by TRADITIONAL_PAY. Our analysis assumes you invest DIFFERENCE_PAY difference in a non-tax-deferred account.<!--/TAXABLE_SAVINGS--> **GRAPH** <h2 class=\'KJEReportHeader KJEFontHeading\'>How was this calculated?</h2> <p><strong>Step 1</strong>: Based on whether you chose to input traditional or Roth the calculator determined the equivalent contribution of the other type that would have the same impact on take home pay. If this amount exceeds your contribution limit, the excess would be invested as after-tax contributions to the plan, an IRA or other tax-deferred vehicle. <p><strong>Step 2</strong>: Calculate the value of a Roth 401(k) if you contributed ANNUAL_ROTH_CONTRIBUTION per year for YEARS_UNTIL_RETIREMENT years earning an assumed RATE_OF_RETURN per year. This equaled TOTAL_ROTH. Since qualified distributions from a Roth 401(k) are not taxed, the total value remains TOTAL_ROTH. <p><strong>Step 3</strong>: Calculate the value of a Traditional 401(k) if you contributed ANNUAL_TRADITIONAL_CONTRIBUTION per year for YEARS_UNTIL_RETIREMENT years earning an assumed RATE_OF_RETURN per year. This equaled V401K_TOTAL_BF_TAX. This is <!--V401K_ROTH_SAME-->equal to<!--/V401K_ROTH_SAME--> <!--V401K_ROTH_DIFF-->higher than<!--/V401K_ROTH_DIFF--> the Roth 401(k) total, TOTAL_ROTH. However, contributions and all earnings in a Traditional 401(k) are taxable when they are withdrawn. After taxes, the value of your Traditional 401(k) account would be V401K_TOTAL_AF_TAX. <p><strong>Step 4</strong>: Finally, the tool accounts for possible differences in take home pay between the two options. This is for situations where the Traditional account contributions might exceed the **CURRENT_YEAR** annual 402(g) limit of PLAN_MAX if your age is less than 50 and PLAN_MAX_CATCHUP if your age is greater than 50. <!--TAXABLE_SAVINGS-->The amount over the limit if invested in a non-tax-deferred account, at a rate of RATE_OF_RETURN for YEARS_UNTIL_RETIREMENT years, could be worth TOTAL_TAXABLE at retirement. This is after earnings are taxed. <!--/TAXABLE_SAVINGS--><!--NOTAXABLE_SAVINGS-->Based on your inputs there is no difference in take home pay, so this additional calculation is not required.<!--/NOTAXABLE_SAVINGS--> <div class=KJEReportTableDiv><table class=\'KJEReportTable KJEReportTableShrink\'><caption class=\'KJEHeaderRow KJEHeading\'>Results Summary</caption> <thead class=\'KJEReportTHeader\'> <tr class=KJEHeaderRow><td class="KJEHeading">&nbsp;</td><th class="KJEHeading" scope=\'col\'>Traditional</th><th class="KJEHeading" scope=\'col\'>Non-Tax-Deferred Account</th><th class="KJEHeading" scope=\'col\'>Total Traditional & Non-Tax-Deferred Account</th><th class="KJEHeading" scope=\'col\'> Roth</th></tr> </thead> <tbody class=\'KJEReportTBody\'> <tr class=KJEOddRow><th class="KJELabel KJECellBorder KJECell40">Total contributions until retirement age: A</th><td class="KJECell KJECellBorder KJECell15">TOTAL_TRADITIONAL_CONTRIBUTIONS</td><td class="KJECell KJECellBorder KJECell15">TOTAL_TAXABLE_CONTRIBUTIONS<td class="KJECell KJECellBorder KJECell15">TOTAL_BOTH_CONTRIBUTIONS<td class="KJECell KJECell15">TOTAL_ROTH_CONTRIBUTIONS</tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder">Current taxes: B</th><td class="KJECell KJECellBorder">$0</td><td class="KJECell KJECellBorder">TOTAL_TAXABLE_CURRENTTAX</td><td class="KJECell KJECellBorder">TOTAL_BOTH_CURRENTTAX</td><td class="KJECell">TOTAL_ROTH_CURRENTTAX</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder">Total contributions plus current taxes (A+B): C</th><td class="KJECell KJECellBorder">TOTAL_TRADITIONAL_CONTRIBUTIONS</td><td class="KJECell KJECellBorder">TOTAL_TAXABLE_COMBINED</td><td class="KJECell KJECellBorder">TOTAL_BOTH_COMBINED</td><td class="KJECell">TOTAL_ROTH_COMBINED</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder">Hypothetical value at retirement age: D</th><td class="KJECell KJECellBorder">V401K_TOTAL_BF_TAX</td><td class="KJECell KJECellBorder">TOTAL_TAXABLE_BF_TAX</td><td class="KJECell KJECellBorder">TOTAL_BOTH_BF_TAX</td><td class="KJECell">TOTAL_ROTH</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder">Taxes at retirement: E</th><td class="KJECell KJECellBorder">- TOTAL_TRADITIONAL_RETIRETAX</td><td class="KJECell KJECellBorder">- TOTAL_TAXABLE_RETIRETAX</td><td class="KJECell KJECellBorder">- TOTAL_BOTH_RETIRETAX</td><td class="KJECell">- TOTAL_ROTH_RETIRETAX</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder">Hypothetical value at retirement after taxes (D-E): F</th><td class="KJECell KJECellBorder">V401K_TOTAL_AF_TAX</td><td class="KJECell KJECellBorder">TOTAL_TAXABLE</td><td class="KJECellStrong KJECellBorder">TOTAL_BOTH</td><td class="KJECellStrong">TOTAL_ROTH</td></tr> </tbody> </table> </div> <h2 class=\'KJEReportHeader KJEFontHeading\'>Your input values</h2> <div class=KJEReportTableDiv><table class=KJEReportTable><caption class=\'KJEHeaderRow KJEHeading\'>Input Summary</caption> <tbody class=\'KJEReportTBody\'> <tr class=KJEOddRow><th class="KJELabel KJECellBorder KJECell60" scope=\'row\'>Current age</th><td class="KJECell KJECell40">CURRENT_AGE</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder" scope=\'row\'>Current contribution type</th><td class="KJECell">CURRENT_CONTRIBUTION_TYPE</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder" scope=\'row\'>Retirement age</th><td class="KJECell">AGE_OF_RETIREMENT</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder" scope=\'row\'>Current annual contribution</th><td class="KJECell">ANNUAL_CONTRIBUTION</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder" scope=\'row\'>Current tax bracket</th><td class="KJECell">CURRENT_TAX_RATE</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder" scope=\'row\'>Hypothetical rate of return</th><td class="KJECell">RATE_OF_RETURN</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder" scope=\'row\'>Retirement tax rate</th><td class="KJECell">RETIREMENT_TAX_RATE</td></tr> <tr class=KJEEvenRow><th class="KJELabel KJECellBorder" scope=\'row\'>Current income</th><td class="KJECell">CURRENT_INCOME</td></tr> <tr class=KJEOddRow><th class="KJELabel KJECellBorder" scope=\'row\'>Pay frequency</th><td class="KJECell">PAY_LABEL</td></tr> </tbody> </table> </div> <h2 class=\'KJEScheduleHeader KJEFontHeading\'>Balances by year*</h2> **REPEATING GROUP** <p class=KJEFooter>* Understand that the likelihood of this scenario unfolding exactly as portrayed is extremely remote. It is based on the assumption that fixed rates of return, that don\'t vary from year to year, will apply to your entire retirement portfolio.</p> ';
KJE.parameters.set("AGE_OF_RETIREMENT",65);
KJE.parameters.set("ANNUAL_CONTRIBUTION",15000);
KJE.parameters.set("CURRENT_AGE",30);
KJE.parameters.set("CURRENT_INCOME",50000);
KJE.parameters.set("CURRENT_TAX_RATE",KJE.Default.TaxRate);
KJE.parameters.set("RATE_OF_RETURN",KJE.Default.RORMarket);
KJE.parameters.set("RETIREMENT_TAX_RATE",KJE.Default.TaxRateRetire);
KJE.parameters.set("PAY_PERIOD",KJE.Default.PAY_MONTHLY);